import React from 'react';

// Sets data for the navbar
export const MenuItems = [
    // First navbar item
    {
        title: 'Program 1',
        path: '/program1',
        cName: 'dropdown-link'
    },
    // Second navbar item
    {
        title: 'Program 2',
        path: '/program2',
        cName: 'dropdown-link'
    },
    // Third navbar item
    {
        title: 'Program 3',
        path: '/program3',
        cName: 'dropdown-link'
    },
    // Fourth navbar item
    {
        title: 'Program 4',
        path: '/program4',
        cName: 'dropdown-link'
    },
    // Fifth navbar item
    {
        title: 'Program 5',
        path: '/program5',
        cName: 'dropdown-link'
    },
]
